import React from "react";
import logo from "../assets/images/logo.png";
import main from "../assets/images/main.png";

const Landing = () => {
  return (
    <main>
      <nav>
        <img src={logo} alt="logo" />
      </nav>
      <div className="container page">
        <div className="info">
          <hi>
            Job <span>Tracking</span>App
          </hi>
        </div>
      </div>
    </main>
  );
};

export default Landing;
